//13.	WAP to print squares from 1 to 20

package AssigmentOnLooping;

public class PrintSquare {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int start = 1;
		int end = 20;

		for (int i = 1; i <= end; i++) {
			int square = i * i;
			System.out.println(square);
		}

	}

}
